insert  into `update_data`(`date`,`contents`) values 
('2019.12.28.31405','1. D-오디오 SUB \'M\' 자동 입력 삭제/2. EO 폼 수정/ - 차종 2글자 대문자 변경 문제로 선택과 입력 매칭 검사 오류 수정/ - EO 선택 시 첫 목록은 차종에 맞는 목록이 표시/ - EO 삭제 오류 수정/3. 인쇄 수정/- 인쇄 테이블 쿼리 전송 문제가 있는 것으로 추정되어 오류 검출 추가/4. 관전자 모드 수정/- 모델 선택할 때 화면이'),
('2020.01.15.41432','1. 업데이트 기능 추가 (파일 자동 정리, 라이브러리 업데이트)/2. 버그 수정/ - 관전자 모드에서 프로그램 멈추는 현상 수정 (내부 로직 변경)'),
('2020.01.20.29652','1. 종료일 조회 버튼 추가/ - 현재 날짜와 종료일을 비교하여 리스트에 출력하는 기능/2. 자동 갱신 기능 오류 수정'),
('2020.01.21.33014','1. 인쇄 오류 수정'),
('2020.02.05.16257','1. 클러스터 검색 기능 비활성화 문제 수정'),
('2020.02.07.17915','1. 해상도에 따라 레이아웃 틀어짐 수정'),
('2020.02.10.24676','1. 클러스터 라인 인쇄 수정/ - \'고객사 EO 전 관리\' 삭제'),
('2020.02.11.35931','1. 차종 입력 문제 수정/ - 첫 2글자만 대문자로 자동 변환'),
